import {
  Stack,
  Button,
  Container
} from "@mui/material";

import Menus from '../Json-api/Menu';
console.log(Menus)
const Navbar = ()=>{
  const design = (
    <>
      <Stack>
      <Container sx={{m:4}}>
        <Stack direction="row" justifyContent="space-between">
         <h4>Testing</h4>
          <Stack direction="row" spacing={1}>
          <Button>Button-1</Button>
          <Button>Button-2</Button>
          <Button>Button-3</Button>
          </Stack>
          </Stack>
        </Container>
      </Stack>
    </>
  );
  return design;
}
export default Navbar;
